window.bookSummaryJSON = "<p>Amelia…</p> <p>So, there were many things I could have done differently.</p> <p>I could have gone on a cruise and forgotten about stealing a killer box from a Vampire King.</p> <p>I could have shaved my head and become a Tibetan monk.</p> <p>I could have also lost my virginity to some nice Texas cowboy who wanted to introduce me to his mother.</p> <p>But instead, I went to Germany and ended up fighting Mercenaries.</p> <p>I also fell in love with a Vampire King who claimed me as his.</p> <p>And now I’m in the river and all because I decided not to just stay home and do my laundry.</p> <p>No, instead...I shot a pilot.</p>"; 
